import {
  BrowserRouter as Router,
  Link,
  Routes,
  Route,

} from "react-router-dom";



function App() {
  return (
    <>


    <Navbar title = "My" />
    <Router>
    <div className="con my-5">
    <Routes>
          <Route path="/about">
            <About />
          </Route>

          <Route path="/">
            <Textform title = "Enter the text" />
          </Route>
    </Routes>

    </div>

    </Router>
    </>
  );
}

export default App;
